BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "Listings" (
	"listingid"	INTEGER,
	"hostid"	INTEGER NOT NULL,
	"listingName"	TEXT NOT NULL,
	"price"	INTEGER,
	"roomType"	TEXT,
	"rating"	INTEGER,
	"photoUrl"	TEXT,
	FOREIGN KEY("hostid") REFERENCES "Hosts"("hostid") ON DELETE CASCADE,
	PRIMARY KEY("listingid" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Reviews" (
	"reviewid"	INTEGER,
	"listingid"	INTEGER NOT NULL,
	"content"	TEXT,
	FOREIGN KEY("listingid") REFERENCES "Listings"("listingid") ON DELETE CASCADE,
	PRIMARY KEY("reviewid" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Hosts" (
	"hostid"	INTEGER,
	"name"	TEXT,
	"email"	TEXT,
	"phone"	NUMERIC,
	PRIMARY KEY("hostid" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "HostInfo" (
	"infoid"	INTEGER,
	"hostid"	INTEGER,
	"responseRate"	REAL,
	"startFrom"	TEXT,
	FOREIGN KEY("hostid") REFERENCES "Hosts"("hostid") ON DELETE CASCADE,
	PRIMARY KEY("infoid" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Guests" (
	"guestid"	INTEGER,
	"name"	TEXT,
	PRIMARY KEY("guestid" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Listing_Guest" (
	"listingid"	INTEGER,
	"guestid"	INTEGER,
	FOREIGN KEY("guestid") REFERENCES "Guests"("guestid") ON DELETE CASCADE,
	FOREIGN KEY("listingid") REFERENCES "Listings"("listingid") ON DELETE CASCADE
);
COMMIT;
